import Skeleton, { SkeletonTheme } from "react-loading-skeleton";
import "../pages/movies.css";
const Smovies = () => {
  return (
    <>
      <SkeletonTheme color="#202020" highlightColor="#2e302e">
        <div className="card">
          <div className="img">
            {<Skeleton height={400} />}
            <img src="./images/space.jpg" alt=""></img>
          </div>
          <h2 className="title">
            <Skeleton height={20} />
            Hello
          </h2>
        </div>
      </SkeletonTheme>
    </>
  );
};

export default Smovies;
